import { useEffect, useState } from 'react';
import classNames from 'classnames/bind';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircleXmark, faSpinner, faMagnifyingGlass, faEllipsisVertical, faGlobe, faCircleQuestion, faKeyboard } from '@fortawesome/free-solid-svg-icons';
import { faMessage, faPaperPlane, faPlusSquare } from '@fortawesome/free-regular-svg-icons';

import Tippy from '@tippyjs/react';
import HeadlessTippy from '@tippyjs/react/headless';

import Button from '~/components/Button';
import styles from './Header.module.scss';
import images from '~/assets/images'
import { Wrapper as PropperWrapper } from '~/components/Propper';
import AccountItem from '~/components/AccountItem';
import Menu from '~/components/Propper/MenuItem';
import 'tippy.js/dist/tippy.css';

const cx = classNames.bind(styles)
const MENU_ITEMS = [
  {
    icon: <FontAwesomeIcon icon={faGlobe} />,
    title: 'English',
    children: {
      title: 'Language',
      data: [
        {
          type: 'language',
          code: 'en',
          title: 'English'
        },
        {
          type: 'language',
          code: 'vi',
          title: 'Tiếng Việt'
        },
        {
          type: 'language',
          code: 'jp',
          title: 'Japanese'
        },
        {
          type: 'language',
          code: 'chn',
          title: 'Chinese'
        },
        {
          type: 'language',
          code: 'ind',
          title: 'Hindi'
        }
      ]
    }
  },
  {
    icon: <FontAwesomeIcon icon={faCircleQuestion} />,
    title: 'Feedback and help',
    to: '/feedback'
  },
  {
    icon: <FontAwesomeIcon icon={faKeyboard} />,
    title: 'Keyboard shortcuts',
  }
]
function Header() {
  const [searchResult, setSearchResult] = useState([])

  useEffect(() => {
    setInterval(() => {
      setTimeout(() => {
        setSearchResult([])
      }, 0)
    })
  }, [])
  //Handle logic
  const handleMenuChange = (menuItem) => {

  }

  const currentUser = true

  const userMenu = [
    {
      icon: <FontAwesomeIcon icon={faCircleQuestion} />,
      title: 'View Profile',
      to: '/@hoaaa'
    },
    {
      icon: <FontAwesomeIcon icon={faCircleQuestion} />,
      title: 'View Profile',
      to: '/@hoaaa'
    },
    ...MENU_ITEMS
  ]

  return (
    <header className={cx('wrapper')}>
      <div className={cx('inner')}>
        <img src={images.logo} alt="Tiktok" />
        <HeadlessTippy
          visible={searchResult.length > 0}
          interactive
          render={attrs => (
            <div className={cx('search-results')} tabIndex="-1">
              <PropperWrapper>
                <h4 className={cx('search-title')}>
                  Accounts
                </h4>
                <AccountItem />
                <AccountItem />
                <AccountItem />
                <AccountItem />
              </PropperWrapper>
            </div>
          )}
        >
          <div className={cx('search')}>
            <input type="text" placeholder="Search accounts and videos" spellCheck={false} />

            {/*Clear*/}
            <button className={cx('clear')}>
              <FontAwesomeIcon icon={faCircleXmark} />
            </button>

            {/*Loading*/}
            <FontAwesomeIcon className={cx('loading')} icon={faSpinner} />

            {/*Search button*/}

            <button className={cx('search-btn')}>
              <FontAwesomeIcon icon={faMagnifyingGlass} />
            </button>

          </div>
        </HeadlessTippy>

        <div className={cx('actions')}>
          {currentUser ? (
            <>
              <Button className={cx('action-upload-btn')} text leftIcon={<FontAwesomeIcon icon={faPlusSquare} />}>
                Upload
              </Button>
              <Tippy content="Messages" placement="bottom">
                <button className={cx('action-btn')}>
                  <FontAwesomeIcon icon={faPaperPlane} />
                </button>
              </Tippy>
              <Tippy content="Inbox" placement="bottom">
                <button className={cx('action-btn')}>
                  <FontAwesomeIcon icon={faMessage} />
                </button>
              </Tippy>
            </>
          ) : (
            <>
              <Button text leftIcon={<FontAwesomeIcon icon={faPlusSquare} />}>
                Upload
              </Button>
              <Button primary>Log in</Button>
            </>
          )}
          <Menu items={currentUser ? userMenu : MENU_ITEMS} onChange={handleMenuChange}>
            {currentUser ? (
              <img src='https://p16-sign-va.tiktokcdn.com/tos-useast2a-avt-0068-giso/1e9ae54599d3fe641c57487daa3d0a4f~c5_100x100.jpeg?x-expires=1681830000&x-signature=0x%2FXs2o8tSbVPb6cqNYuhGa2CWM%3D' className={cx('user-avatar')} alt="" />
            ) : (
              <button className={cx('more-btn')}>
                <FontAwesomeIcon icon={faEllipsisVertical}></FontAwesomeIcon>
              </button>
            )}
          </Menu>
        </div>
      </div >
    </header >
  );
}

export default Header;
